#!/usr/bin/env python3# Exercise: Presidents# Author GitHub usernames:# #1: carinasauter# #2: shannonh90# Instructions:# Write a program to:# (1) Load the data from presidents.txt into a dictionary.# (2) Print the years the greatest and least number of presidents were alive.#     (between 1732 and 2016 (inclusive))#     Ex.#       'least = 2015'#       'John Doe'#       'most = 2015'#       'John Doe, Jane Doe, John Adams, and Jane Adams'# Bonus: Confirm there are no ties. If there is a tie print like so:#     Ex.#       'least = 1900, 2013-2015'#       'John Doe (1900)'#       'Jane Doe (2013-2015)'#       'most = 1900-1934, 2013'#       'John Doe, Jane Doe, John Adams, and Jane Adams (1900-1933)'#       'Sally Doe, Billy Doe, Mary Doe, and Cary Doe (1934)'#       'Alice Doe, Bob Doe, Zane Doe, and Yi Do (2013)'# (3) Write your print statements to a file (greatest_least.txt) as well.# Upload that file as well.############################################################################### Importsimport operator# Bodydef get_dict_of_pres():    dictionary_of_presidents = {}    with open("presidents.txt", "r") as doc:        text = doc.readlines()        for line in text:            line = line.strip().split(",")            dictionary_of_presidents[line[0]] = (line[1], line[2])    return dictionary_of_presidentsdef earliest_year_of_birth(d):    min = 2016    for president in d:        if min > int(d[president][0]):            min = int(d[president][0])    return mindef new_dict_of_pres(d):    new_dict_of_pres = {}    for x in range(earliest_year_of_birth(get_dict_of_pres()), 2017):        number_of_presidents_alive = 0        alives = []        for president in d:            if x >= int(d[president][0]):                try:                    if x <= int((d[president][1])):                        number_of_presidents_alive += 1                        alives.append(president)                except:                    if (d[president][1]) == "None":                        number_of_presidents_alive += 1                        alives.append(president)        new_dict_of_pres[x] = (number_of_presidents_alive, alives)    return new_dict_of_presdictionary = new_dict_of_pres(get_dict_of_pres())sorted_dict = sorted(dictionary.items(), key = operator.itemgetter(1))def return_presidents_for_year(year, dictionary):    return dictionary[year][1]def least_number_alive(dictionary, number):    for year in dictionary:        year_pres_combo = year[1]        lst_of_pres = year_pres_combo[1:]        if year_pres_combo[0] == number: # number of presidents alive in the year and compare that to known min            print(lst_of_pres)##############################################################################def main():  # CALL YOUR FUNCTION BELOW    sorted_dict = sorted(dictionary.items(), key = operator.itemgetter(1))    print(least_number_alive(sorted_dict,18))    return_presidents_for_year(2016, dictionary)if __name__ == '__main__':    main()